type TestPkg struct {
	e int
	v string
	r string
}

func (c *TestPkg) Name() string    { return "test" }
func (c *TestPkg) Epoch() int      { return c.e }
func (c *TestPkg) Version() string { return c.v }
func (c *TestPkg) Release() string { return c.r }

func sign(r int) string {
	if r < 0 {
		return "<"
	} else if r > 0 {
		return ">"
	}

	return "=="
}

